#! /usr/bin/env python3
import ics
import json
import base64
import re
import logging
import jsonpickle
from datetime import datetime

logger = logging.getLogger()
logger.setLevel(logging.INFO)

months = {
  'January': 1,
  'February': 2,
  'March': 3,
  'April': 4,
  'May': 5,
  'June': 6,
  'July': 7,
  'August': 8,
  'September': 9,
  'October': 10,
  'November': 11,
  'December': 12
}

year = datetime.now().year

def spaces2ical(event, context):
  logger.info("Event: " + jsonpickle.encode(event))
  for record in event['Records']:
    message = record['Sns']['Message']
    logger.info("Message: " + message)
    m = jsonpickle.loads(message)

    booking = {}
    for header in m['mail']['headers']:
      if header['name'] == 'From':
        booking['sender_address'] = header['value']

    body = base64.b64decode(m['content']).decode("utf-8")

    date_pattern = re.compile("\*?(\w+) (\d\d?)\w\w (\w+)\**\s*$")
    desk_pattern = re.compile("Desk (\d+)\s*")

    for line in body.splitlines():
      if 'date' in booking and 'desk' in booking:
        break

      if not 'date' in booking:
        result = date_pattern.search(line)
        if result:
          booking['date'] = date_string(result.groups())
      if not 'desk' in booking:
        result = desk_pattern.search(line)
        if result:
          booking['desk'] = result.group(1)

    print(booking)
    create_ics(booking)


def date_string(date):
  day_name = date[0]
  day_num = int(date[1])
  month_name = date[2]
  month_num = months[month_name]
  date_string = "{:04d}-{:02d}-{:02d}".format(year, month_num, day_num)
  return date_string

def create_ics(booking):

    c = ics.Calendar()
    e = ics.Event()
    e.name = 'Event Name'
    e.dtstamp = '2023-05-13 14:00:00'
    e.begin = booking['date'] + ' 09:00:00'
    e.end   = booking['date'] + ' 17:00:00'
    e.description = 'Desk ' + booking['desk']
    e.location = 'London'
    # Outlook seems to ignore the standard `fbtypeparam` field, MS has their own
    e.extra.append( ics.utils.ContentLine(name='fbtypeparam', value='FREE') )
    e.extra.append( ics.utils.ContentLine(name='X-MICROSOFT-CDO-BUSYSTATUS', value='FREE') )
    # A dtstamp field is apparently always required, I don't know why the ics lib doesn't create it
    e.extra.append( ics.utils.ContentLine(name='dtstamp', value='20230513T140000Z') )
    c.events.add(e)

    print (c.serialize())

